import React from "react";
import LevelOne from "./components/LevelOne";

class LevelTest extends React.Component {

    state = {
        message: "hello world"
    };

    render() {


        return (
            <div>
                <LevelOne/>
                <p>({this.state.message})</p>
            </div>
        )
    };
}

export default LevelTest;
